import { findByLabelText } from "@testing-library/dom";
import { alpha, makeStyles, Theme, createStyles } from '@material-ui/core/styles';
export default makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },


    nav: {
        display: 'flex',
        alignItems: 'center',
        marginRight: 1.2,
        fontSize: '14px',
        fontWeight: 550,
    },
    navbar: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: 1,
    },
    left: {
        display: 'flex',
        alignItems: 'center',
    },
    logo: {
        fontSize: '1rem',
        color: '#000',
    },
    navSearchForm: {
        marginLeft: 1,
    },
    categoryNav: {
        display: 'flex',
        paddingLeft: 0.6,
        overflow: 'hidden',
    },
    category: {
        padding: 0.8,
    },
   //new line
   grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    display: 'none',
    fontSize: '1.1rem',
    [theme.breakpoints.up('sm')]: {
      display: 'block',
    },
  },
  search: {
    zIndex: 2,
    margin: '1rem 0.6rem 0 0',
    width: '70%',
    padding: '1.2rem',
    borderRadius: '5px',
    border: 'none',
    color: '#000',
    fontSize: '0.9rem',
  },

  inputRoot: {
    width: '70%',
    padding: '1.2rem',
    borderRadius: '5px',
    border: 'none',
    color: '#000',
    fontSize: '0.9rem',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
  sectionDesktop: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'flex',
    },
  },
  sectionMobile: {
    display: 'flex',
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
  }))
